export interface Infracao {
  id?: string;
  resumo: string;
  descricao_completa: string;
  fundamento_legal: string;
  natureza_multa?: string;
  valor_minimo?: number;
  valor_maximo?: number;
  valor_por_unidade?: number | null;
  unidade_de_medida?: string | null;
  criterios_aplicacao?: string;
  observacoes?: string;
  _categoria?: string;
  _tipo_multa_computado?: "aberta" | "fechada";
  // Campos de compatibilidade
  label?: string;
  artigo?: string;
  descricao?: string;
  gravidade?: string;
  unidade?: string;
  [key: string]: any;
}

export interface InfracaoBloco {
  tipo_infracao: string;
  infracoes: Infracao[];
}

// String Base64 contendo o JSON original completo (102 infrações)
// Garante que não haja erro de digitação manual
const RAW_DATA_B64 = "";

// Função que roda apenas no cliente para evitar erros de hidratação e garantir window.atob
function getProcessedData(): InfracaoBloco[] {
  try {
    // Decodifica Base64 de forma segura em qualquer ambiente JS moderno
    const decoded = typeof atob === 'function' 
      ? atob(RAW_DATA_B64)
      : Buffer.from(RAW_DATA_B64, 'base64').toString('binary');
      
    const jsonString = decodeURIComponent(escape(decoded));
    const rawData: any[] = JSON.parse(jsonString);

    return rawData.map((bloco: any) => ({
      tipo_infracao: bloco.tipo_infracao || "Outros",
      infracoes: (bloco.infracoes || []).map((inf: any, idx: number) => {
        // DETECÇÃO AUTOMÁTICA DE TIPO (Preservando lógica original)
        let tipo = "aberta";
        if (inf.natureza_multa) {
          tipo = inf.natureza_multa.toLowerCase();
        } else if (inf.valor_por_unidade || (inf.unidade_de_medida && inf.unidade_de_medida.trim())) {
          tipo = "fechada";
        } else if (inf.valor_minimo && inf.valor_maximo) {
          tipo = "aberta";
        }

        // Importante: NÃO criar label manual aqui para deixar o componente UI 
        // formatar com a função formatFundamento()
        
        return {
          ...inf,
          id: `${bloco.tipo_infracao}-${idx}-${Math.random().toString(36).substr(2, 9)}`,
          _categoria: bloco.tipo_infracao,
          _tipo_multa_computado: tipo,
          valor_minimo: Number(inf.valor_minimo) || 0,
          valor_maximo: Number(inf.valor_maximo) || 0,
          valor_por_unidade: Number(inf.valor_por_unidade) || 0,
        };
      })
    }));
  } catch (e) {
    console.error("Erro fatal ao carregar dados:", e);
    return [];
  }
}

// Exporta os dados já processados
export const infracoesData: InfracaoBloco[] = getProcessedData();
